webpackJsonp([0xf927f8900006],{691:function(t,n){t.exports={data:{page:{id:"/Users/manrajsingh/Github/blog/content/pages/1--about/index.md absPath of file >>> MarkdownRemark",html:'<p>This is a demo site of the <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">PersonalBlog</a> GatsbyJS starter.</p>\n<p>The starter is a ready to use, easy to customize ‘like theme’ starter. It has everything what blog should have and some more.</p>\n<h3>Standard features:</h3>\n<ul>\n<li>Easy editable content in <strong>Markdown</strong> files (posts, pages and parts)</li>\n<li><strong>SEO</strong> (sitemap generation, robot.txt, meta and OpenGraph Tags)</li>\n<li><strong>Social</strong> sharing (Twitter, Facebook, Google, LinkedIn)</li>\n<li><strong>Comments</strong> (Facebook)</li>\n<li><strong>Images</strong> lazy loading and <code class="language-text">webp</code> support (gatsby-image)</li>\n<li>Post <strong>categories</strong> (post list filtering)</li>\n<li>Full text <strong>searching</strong> (Algolia)</li>\n<li><strong>Contact</strong> form (Netlify form handling)</li>\n<li><strong>RSS</strong> feed</li>\n<li><strong>PWA</strong> (manifes.json, offline support, favicons)</li>\n<li>Google <strong>Analytics</strong></li>\n<li><strong>Favicons</strong> generator (node script)</li>\n<li><strong>Material UI</strong> (@next)</li>\n</ul>\n<h3>Advanced features:</h3>\n<ul>\n<li>Easy customizable base <strong>styles</strong> via <code class="language-text">theme</code> object (fonts, colors, sizes)</li>\n<li><strong>Components</strong> lazy loading (social sharing, comments)</li>\n<li><strong>ESLint</strong> (google config)</li>\n<li><strong>Prettier</strong> code styling</li>\n<li>Custom webpack <code class="language-text">CommonsChunkPlugin</code> settings</li>\n<li>Webpack <code class="language-text">BundleAnalyzerPlugin</code></li>\n<li>Contact <strong>form validation</strong> (react-material-ui-form-validator)</li>\n</ul>\n<h2>Instructions</h2>\n<p>For detailed instructions go to <a href="https://dev.greglobinski.com/gatsby-starter-personal-blog/">Front-end web development with Greg</a>.</p>',frontmatter:{title:"About"}},footnote:{id:"/Users/manrajsingh/Github/blog/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<p>Copyright © <a href="https://manrajsingh.in/">Manraj Singh</a></p>'}},pathContext:{slug:"/about/"}}}});
